import React, { useState } from 'react';
import axios from 'axios';
import './view.css';


const Output = () => {
  const [circle, setCircle] = useState('');
  const [year, setYear] = useState('');
  const [month_of_year, setMonth] = useState('');
  const [fetchedData, setFetchedData] = useState([]);


  const handleCircleChange = (e) => {
    setCircle(e.target.value);
  };

  const handleYearChange = (e) => {
    setYear(e.target.value);
  };

  const handleMonthChange = (e) => {
    setMonth(e.target.value);
  };



  const handleSearch = (e) => {
    e.preventDefault();
    axios
      .get(`/view?circle=${circle}&year=${year}&month=${month_of_year}`)
      .then((response) => {
        setFetchedData(response.data);

        const filteredData = fetchedData.filter((item)=> {
          if (circle && item.circle !== circle) return false;
          if (year && item.year !== year) return false;
          if (month_of_year && item.month_of_year !== month_of_year) return false;
          return true;
        });


      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  };

    // Filter data based on search criteria


  return (
    <div>
       <h1 className='makesure'>View Data</h1>
      <div className="choosing">

     <div>
     <form>
       <div className='bsbc'>
       <div className='dsdc'>
        <label>
          Circle:
          <input type='text' value={circle} onChange={handleCircleChange} />
        </label>
      </div>
      <div className='dsdc'>
        <label>
          Month:
          <input type='text' value={month_of_year} onChange={handleMonthChange} />
        </label>
      </div>
        <div className='dsdc'>
        <label>
          Year:
          <input type='number' value={year} onChange={handleYearChange} />
        </label>
      </div>
       </div>
        <button type="submit" className='getMore' onClick={handleSearch}>Get Output</button>
      </form>
     </div>
    </div>
    {fetchedData.length > 0 && (
      <div>
        <h2 className='tabledata'>Fetched Data</h2>
        <div className='table-container'>
          <table className='data-table'>
            <thead>
              <tr>
              <th>Circle</th>
              <th>Division</th>
              <th>Sub-Division</th>
                <th>Month</th>
                <th>Year</th>
                <th>Injection</th>
                <th>Unit Billed</th>
                {/* Add more table headers for other data fields */}
              </tr>
            </thead>
            <tbody>
              {filteredData.map((item, index) => (
                <tr key={index}>
                  <td>{item.circle}</td>
                  <td>{item.division}</td>
                  <td>{item.subdivision}</td>
                  <td>{item.month_of_year}</td>
                  <td>{item.year}</td>
                  <td>{item.injection}</td>
                  <td>{item.unit_billed} </td>

                  {/* Add more table data cells for other data fields */}
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    )}
    </div>
  );
};

export default Output;
